We have
\begin{align*} \frac{\frac{3}{8}+\frac{7}{8}}{\frac{4}{5}} &= \frac{\frac{3+7}{8}}{\frac{4}{5}} \\ &= \frac{\frac{10}{8}}{\frac{4}{5}} \\ &= \frac{\frac{5}{4}}{\frac{4}{5}} \\ &= \frac{5}{4} \cdot \frac{5}{4} \\ &= \frac{25}{16} \end{align*}
Thus, the answer is $\boxed{\frac{25}{16}}$.

We have the system of equations
\begin{align*} 3a+2b&=5 \\ a+b&=2 \end{align*}
Multiplying the second equation by 2, we get $2a+2b=4$. Subtracting this from the first equation gives $(3a+2b)-(2a+2b)=5-4$, so $a=1$. Substituting $a=1$ into the second equation gives $1+b=2$, so $b=1$. Thus, the ordered pair is $\boxed{(1,1)}$.

We are given that $a=8$. We want to find the value of $\left(16\sqrt[3]{a^2}\right)^{\frac 13}$.
Substituting $a=8$, we have
\begin{align*} \left(16\sqrt[3]{8^2}\right)^{\frac 13} &= \left(16\sqrt[3]{64}\right)^{\frac 13} \\ &= (16\cdot 4)^{\frac 13} \\ &= (64)^{\frac 13} \\ &= \sqrt[3]{64} \\ &= \boxed{4}\end{align*}

We can group the terms in pairs:
\begin{align*} (100 - 99) + (98 - 97) + (96 - 95) + \dots + (4 - 3) + (2 - 1) &= 1 + 1 + 1 + \dots + 1 + 1 \\ &= \underbrace{1 + 1 + \dots + 1}_{50 \text{ times}} \\ &= 50 \cdot 1 \\ &= 50. \end{align*}
There are 50 pairs of numbers, each of which has a difference of 1.  Therefore, the sum is $50 \cdot 1 = \boxed{50}.$

