judge_input:
Prompt: Square $ABCD$ and equilateral triangle $AED$ are coplanar and share $\overline{AD}$, as shown. What is the measure, in degrees, of angle $BAE$? [asy] size(3cm);
pair A,B,C,D,E;
A = (0,0);
B = (0,1);
C = (1,1);
D = (1,0);
E = dir(60);
draw(A--B--C--D--E--A--D);
label("$A$",A,dir(180));
label("$B$",B,dir(180));
label("$C$",C,dir(0));
label("$D$",D,dir(0));
label("$E$",E,dir(0));
[/asy]
Output A: Let's approach this step-by-step:

1) In a square, all angles are 90°. So angle BAD is 90°.

2) In an equilateral triangle, all angles are 60°. So angle DAE is 60°.

3) Angle BAE is the difference between these two angles:

   BAE = BAD - DAE = 90° - 60° = 30°

Therefore, the measure of angle BAE is \boxed{30°}.
Output B: To solve this problem, we need to determine the measure of angle \( \angle BAE \) in the given configuration where square \( ABCD \) and equilateral triangle \( AED \) share side \( \overline{AD} \).

1. **Properties of the Square and Equilateral Triangle:**
   - Since \( ABCD \) is a square, all its angles are \( 90^\circ \).
   - Since \( AED \) is an equilateral triangle, all its angles are \( 60^\circ \).

2. **Analyzing the Configuration:**
   - \( \angle BAD \) is an angle in the square, so \( \angle BAD = 90^\circ \).
   - \( \angle DAE \) is an angle in the equilateral triangle, so \( \angle DAE = 60^\circ \).

3. **Finding \( \angle BAE \):**
   - \( \angle BAE \) is the angle formed by the line segments \( \overline{BA} \) and \( \overline{AE} \).
   - Since \( \angle BAD = 90^\circ \) and \( \angle DAE = 60^\circ \), we can find \( \angle BAE \) by subtracting \( \angle DAE \) from \( \angle BAD \):
     \[
     \angle BAE = \angle BAD - \angle DAE = 90^\circ - 60^\circ = 30^\circ.
     \]

Therefore, the measure of angle \( \angle BAE \) is \(\boxed{30}\) degrees.

